import React, { useState } from 'react';
import TaskList from '../Components/taskList';
import AddTaskDialog from "../Components/AddTaskDialog"; // Assuming the correct path to AddTaskDialog component

const DashboardPage = () => {
  const [openAddDialog, setOpenAddDialog] = useState(false);

  const handleOpenAddDialog = () => {
    setOpenAddDialog(true);
  };

  const handleCloseAddDialog = () => {
    setOpenAddDialog(false);
  };

  return (
    <div>
      <TaskList />
      <button onClick={handleOpenAddDialog}>Add Task</button>
      <AddTaskDialog open={openAddDialog} onClose={handleCloseAddDialog} />
    </div>
  );
};

export default DashboardPage;
